function AS_Button_Delete(eventobject, context){
  try{
    var form = kony.application.getCurrentForm();
    if (form && form.controller && typeof form.controller.deletedTask === "function"){
      form.controller.deletedTask(context);
      return;
    }
    kony.ui.Alert({message: "frmHome controller.deletedTask NOT Found", alertType: constants.ALERT_TYPE_INFO}, {});

  }catch(e){
    kony.ui.Alert({message: "ERR" + e , alertType: constants.ALERT_TYPE_INFO}, {});

  }
}
